export default function App()
{
    async function getData()
    {
        try 
        {
          let response = await fetch("https://storage.googleapis.com/programiz-static/hiring/software/job-listing-page-challenge/data.json");
          return response.json();
        }
        catch(error)
        {
          console.error(error);
        }
    }

    const data = getData().then((value)=>{return value});

    console.log(data);

    return(
        <div>
            Test
        </div>
    );
}
